import React, { Component} from 'react';


class Display extends Component {
    render(){
        console.log(this.props);
        const { name,age,birthMonth } = this.props;
        return (
            <div>
                <div> Name: { name }</div>
                <div> Age: { age }</div>
                <div> BirthMonth: { birthMonth }</div>
            </div>
        )

    }
}
export default Display;
